window.bookSummaryJSON = "<p>Finley and her guys fought until the very end in the Winter Court of the Faerie Realm. They came away with the second piece of the map and left the Winter Court in better hands than when they arrived.</p> <p>After returning home, they received the next part of the poem, and where the third piece of the map is hidden. They have to travel through hell, literally, to get it.</p> <p>There's more than one surprise ready for them as Finley and her guys' journey through the nine levels of hell and into the very pits.</p> <p>A date with the devil is all she needs. Should be easy...right?</p> <p>Finding a way to steal from Lucifer isn't the only thing looming over them. The levels of hell affect some more than others.</p> <p>Will Finley get lost in her anger? Will Obsidian cave to the violence? Or will they learn more about themselves?</p> <p><b>Contains mature themes.</b></p>"; 
